INSERT INTO `tipo_de_atendimento` VALUES (1,'Ressonância magnetica na região da cabeça','00:35:00','Não possui efeitos colaterais.',1000),(2,'Acupuntura','01:15:00','Não possui efeitos colaterais.',2323),(3,'Cirurgia','04:35:00','Possui riscos de efeitos colaterais de perda de movimento da mão, perda do movimento dos dedos.',34433),(4,'Cirurgia Torácica','08:20:00','O principal efeito colateral da simpatectomia é o chamado efeito compensatório. Esse efeito é descrito quando ocorrem episódios de sudorese em outras partes do corpo que não eram habituais antes da cirurgia. Habitualmente, o efeito compensatório ocorre no tronco, pernas, abdome, coxas, virilhas, pés e glúteos. O efeito compensatório tem grande relevância, pois seu grau de intensidade influencia diretamente a qualidade de vida do paciente.',3433),(5,'Consulta períodica','00:30:00','Não possui efeitos colaterais',433433),(6,'Cirurgia Vascular','01:30:00','Possui riscos de inchaço e escoriações',34322),(7,'Fisioterapia para as pernas','00:25:00','Não possui efeitos colaterais',6543),(8,'Consulta periódica','05:00:00','O paciente pode sentir dor leve no momento da punção da fístula com as agulhas. Quanto aos efeitos colaterais, no geral, os pacientes são sentem nada, mas pode ocorrer queda da pressão arterial, câimbras ou dor de cabeça.',54233),(9,'Quimioterapia','02:20:00','O tratamento com quimioterapia pode causar diferentes efeitos colaterais, como queda de cabelo, diarreia, feridas na boca, náuseas e vômitos, pele sensível e até mesmo infertilidade.',34334),(10,'Consulta','00:45:00','Não possui efeitos colaterais',98765),(11,'Quimioterapia','00:40:00','O tratamento com quimioterapia pode causar diferentes efeitos colaterais, como queda de cabelo, diarreia, feridas na boca, náuseas e vômitos, pele sensível e até mesmo infertilidade.',4565),(12,'Diagnóstico e tratamento da doença renal crônica','01:50:00','Não possui efeitos colaterais',6453),(13,'Cirurgia','08:15:00','As complicações neurológicas incluem diminuição do nível de consciência, vasoespasmo, convulsões, hipertensão intracraniana, déficits motores, entre outros. Já as complicações sistêmicas incluem náuseas e vômitos, hipotensão, desconforto respiratório e infecção do sítio cirúrgico, dor e infecções nosocomiais.',2455),(14,'Consulta','00:30:00','Não possui efeitos colaterais',2353),(15,'Consulta','00:25:00','Não possui efeitos colaterais',235235),(16,'Consulta','00:55:00','Não possui efeitos colaterais',32676),(17,'Remoção das pedras nos rins','04:15:00','É comum sentir uma dor lombar aguda, unilateral, que tende a se deslocar para as partes mais baixas do abdome. Em alguns casos, os homens também sofrem um desconforto nos testículos e as mulheres, nos grandes lábios.',641236),(18,'Examinação das  glândulas','00:30:00','Não possui efeitos colaterais',5643445),(19,'Diagnóstico de doenças cardiovasculares','01:30:00','Não possui efeitos colaterais',43544531),(20,'Cirurgia bariátrica','09:15:00','Alguns efeitos colaterais, dependendo do tipo de cirurgia, são até comuns. Nos meses imediatamente posteriores à operação, relatos de perda leve de memória, irritação e insônia tornam-se habituais em hospitais e consultórios',53632),(21,'Transplante de fígado','04:40:00','Com o uso de imunossupressores podem surgir sintomas como inchaço corporal, aumento do peso, aumento da quantidade de pelos no corpo, especialmente no rosto das mulheres, osteoporose, má digestão, queda de cabelo e aftas. Assim, deve-se observar os sintomas que aparecem e conversar com o médico para que ele indique o que se pode fazer para controlar estes sintomas desagradáveis, sem prejudicar o esquema de imunossupressão.',4543),(22,'Acompanhamento médico','00:35:00','Não possui efeitos colaterais',64334),(23,'Consulta','00:50:00','Não possui efeitos colaterais',64324),(24,'Ultrassom','00:25:00','Não possui efeitos colaterais',98765),(25,'Cirurgia na região bucal','00:15:00',' O edema ou inchaço pode ocorrer em maior, ou menor grau dependendo da pessoa;Dor no local. Devido à intervenção, é comum que o local fique bastante dolorido; Cicatrização. O processo de cicatrização é relativo e pode demorar mais ou menos dependendo da pessoa; Trismo; Mau hálito; Parestesia; Dores de garganta.',324567),(26,'Terapia','00:50:00','Não possui efeitos colaterais',123456),(27,'Substituição de uma medula óssea','06:50:00','Náusea e vômito; Feridas na boca; Fadiga; Níveis baixos de plaquetas, dificultando a coagulação do sangue; Níveis baixos de glóbulos vermelhos, causando anemia; Diarreia.',1234567890),(28,'Cirurgia','10:15:00','Os efeitos colaterais pós-cirúrgicos costumam desaparecer por volta dos primeiros 7 a 10 dias. A maioria dos pacientes se queixa de irritação ou sensação leve de areia nos olhos, coceira e sensibilidade a luz. ',34345),(29,'Quimioterapia','00:40:00','O tratamento com quimioterapia pode causar diferentes efeitos colaterais, como queda de cabelo, diarreia, feridas na boca, náuseas e vômitos, pele sensível e até mesmo infertilidade.',64533),(30,'Remorção dos braços','00:56:00','sonolência,\nexcessivo,\nboca seca,\nfadiga,\nAlergia,\ntremor,\nSuor,\nfadiga,\nsonolência,\nexcessivo,\nSuor',51449),(31,'Remorção das pernas','02:45:00','boca seca,\nboca seca,\nboca seca,\nexcessivo,\nnáusea,\ntremor',56741),(32,'Remorção dos olhos','00:28:00','boca seca,\nsonolência,\nsonolência,\ninsônia,\nnáusea,\nSuor,\nsonolência,\nAlergia,\ndiarreia,\nansiedade',48567),(33,'Remorção da língua','03:06:00','boca seca,\nfadiga,\nsonolência,\nfadiga,\nansiedade,\nboca seca,\nexcessivo,\ninsônia,\nsonolência,\nansiedade',49479),(34,'Transplante dos braços','00:31:00','tremor,\nnáusea,\nexcessivo,\nboca seca,\ninsônia,\nexcessivo,\nSuor,\ndiarreia,\nboca seca',50034),(35,'Transplante das pernas','00:24:00','tremor,\ntremor,\ndiarreia,\nnáusea,\nnáusea,\ndiarreia,\nfalta de apetite,',42768),(36,'Transplante dos olhos','00:16:00','',53615),(37,'Transplante da língua','03:01:00','',48899),(38,'Analise dos braços','01:02:00','ansiedade',48465),(39,'Analise das pernas','01:05:00','tremor,\ndiarreia,\ntremor,\nfalta de apetite,',33028),(40,'Analise dos olhos','01:41:00','falta de apetite,,\ninsônia,\ndiarreia,\ndiarreia,\nnáusea,\nansiedade,\nAlergia,\ndiarreia,\nSuor,\nboca seca,\nfalta de apetite,',53371),(41,'Analise da língua','00:26:00','Alergia,\nfadiga,\ntremor,\ndiarreia,\nboca seca,\nfalta de apetite,,\nnáusea,\nexcessivo,\nboca seca,\nnáusea',75422),(42,'Cura dos braços','00:06:00','fadiga',47473),(43,'Cura das pernas','02:14:00','diarreia,\nansiedade,\nboca seca,\nfadiga,\nnáusea',38978),(44,'Cura dos olhos','03:03:00','ansiedade,\ntremor,\nnáusea,\nsonolência,\nfadiga,\nsonolência,\nfadiga,\nboca seca,\nAlergia',49477),(45,'Cura da língua','00:40:00','Suor,\ninsônia,\nfadiga,\nsonolência,\nansiedade,\nfadiga,\nfalta de apetite,,\nfadiga,\nfalta de apetite,,\ninsônia,\nansiedade',50506);
